export default function LoadBook(props) {
  return <div>War and Peace {props.res}</div>;
}

LoadBook.getInitialProps = async function() {
  const res = fetch("http://www.gutenberg.org/files/2600/2600-0.txt").then(
    function(response) {
      return response;
    }
  );
  return { res };
};

